import React from "react";
import Landing from "../../components/landing";
import Intro from "../../components/intro";
import Stastep from "../../components/stastep";
import Footer from "../../components/footer";

import STEP1BACK from "../../assets/img/step1-back.png";
import STEP2BACK from "../../assets/img/step2-back.png";
import STEP3BACK from "../../assets/img/step3-back.png";

import "./style.scss";

const stadata = {
  title: {
    left: (
      <span>
        3 Step use for Fashionista<br></br>EARN EASILY AT HOME
      </span>
    ),
    right: (
      <span>
        EASILY<br></br>Earn
      </span>
    )
  },
  step1: {
    num: "01",
    title: "Schedule your Work",
    desc: (
      <span>
        Showcase who you are, your past work and what<br></br> you are looking
        for
      </span>
    ),
    img: STEP1BACK
  },
  step2: {
    num: "02",
    title: "Accept and Manage appointments",
    desc:
      "Find and get contacted by the most relevant influencers for your brand or company with complete transparency on their profile audience statistics, portfolio, past reviews)",
    img: STEP2BACK
  },
  step3: {
    num: "03",
    title: (
      <span>
        Earn easily from<br></br> anywhere
      </span>
    ),
    desc: (
      <span>
        Discuss directly with the influencer and<br></br> agree on the terms of
        the collaboration
      </span>
    ),
    img: STEP3BACK
  }
};

function DefaultFashionista() {
  return (
    <div className="home">
      <Landing></Landing>
      <Intro></Intro>
      <Stastep {...stadata}></Stastep>
      <Footer></Footer>
    </div>
  );
}

export default DefaultFashionista;
